import WindowWithForm from "../WindowWithForm/WindowWithForm.jsx";
import Input from "../Input/Input.jsx";
import "./Register.css";

export default function Register() {
  return (
    <WindowWithForm  
    heading={"Добро пожаловать!"}
    btnText={"Зарегистрироваться"}
    question={"Уже зарегистрированы?"}
    link={"/signin"}
    linkText={"Войти"} 
    ariaLabel={"Вход в аккаунт"}
  >
      <Input
        name={"Имя"}
        inputId={"inputName"}
        inputType={"text"}
        placeholder={"Имя"}
        defaultValue={"Виталий"}
        min={2}
        max={30}
        errText={"Что-то пошло не так..."}
      />
      <Input
        name={"E-mail"}
        inputId={"inputEmail"}
        inputType={"Email"}
        placeholder={"Email"}
        defaultValue={"pochta@yandex.ru"}
        errText={"Что-то пошло не так..."}
      />
      <Input
        name={"Пароль"}
        inputId={"inputPassword"}
        inputType={"password"}
        placeholder={"Пароль"}
        defaultValue={"••••••••••••••"}
        min={6}
        errText={"Что-то пошло не так..."}
      />
    </WindowWithForm>
  )
}
